import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import minimalist2 from "../assets/minimalist2.jpg";
import minimalist3 from "../assets/minimalist3.jpg";

const Loginto = () => {
  return (
    <div>
      <Personal_1_login />
    </div>
  );
};

const Personal_1_login = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [loggedIn, setLoggedIn] = useState(false); // State to manage login status

  const [alertMessage, setAlertMessage] = useState("");
  const [alertType, setAlertType] = useState("");

  const navigate = useNavigate();

  const onSubmit = async (event) => {
    event.preventDefault();

    try {
      const result = await axios.post("/auth/personal1-login", {
        username,
        password,
      });

      window.localStorage.setItem("userID", result.data.userID);
      setLoggedIn(true); // Set login status to true
      setAlertMessage("Logged in successfully");
      setAlertType("success");
      // Navigate to the desired route after successful login
      navigate("/Fetchalldata1proc");
    } catch (error) {
      setAlertMessage("Incorrect Credentials");
      setAlertType("error");
      console.error(error);
    }
  };

  return (
    <div>
      <div className="login-register">
        <img className="useru-logo" src={minimalist2} alt="" />
        <img className="userp-logo" src={minimalist3} alt="" />
        {/* Conditionally render welcome message if user is logged in */}
        {loggedIn ? (
          <div>
            <h4>Welcomee, {username}!</h4>
            {/* You can add additional content or logout button here */}
          </div>
        ) : (
          <form onSubmit={onSubmit}>
            <h4 className="login-name">Personal 1</h4>
            <div className="form-group">
              <input
                type="text"
                id="username "
                value={username}
                onChange={(event) => setUsername(event.target.value)}
                placeholder="Username"
              />
            </div>
            <div className="form-group">
              <input
                type="password"
                id="password"
                value={password}
                onChange={(event) => setPassword(event.target.value)}
                placeholder="Password"
              />
            </div>
            <button className="submit" type="submit">
              Login
            </button>
          </form>
        )}
      </div>
      {/* Custom styled alert */}
      {alertMessage && (
        <div className={`alert-all ${alertType} slideIn `}>
          {alertMessage} <br />
          <button className="close" onClick={() => setAlertMessage("")}>
            Close
          </button>
        </div>
      )}
    </div>
  );
};

export default Loginto;
